import { useState } from 'react';

const ThemeClasses = () => {
  const [fontFamilies, setFontFamilies] = useState([
    {
      id: 11,
      fontDefault: 'Montserrat, sans-serif',
      fontStyle: 'Ranchers, display',
      fontAccent: 'Licorice, handwriting',
    },
    {
      id: 12,
      fontDefault: 'Montserrat, sans-serif',
      fontStyle: 'Ranchers, display',
      fontAccent: 'Licorice, handwriting',
    },
    {
      id: 13,
      fontDefault: 'Montserrat, sans-serif',
      fontStyle: 'Ranchers, display',
      fontAccent: 'Licorice, handwriting',
    },
  ]);
  return (
    <>
      <div className='containerFluid1 container1-lg'>
        <div className='mainTitle pb2'>
          <h5 className='fontStyle fsH3'>Font Family:</h5>
        </div>

        <div className='headingsNames sectionTitle'>
          {fontFamilies.map((font) => (
            <div>
              <div className='fontDefault fsMD pb1'>
                <h6 className='fsMD'>.fontDefault:</h6>
                <p className='fsSM'>font-family: '{font.fontDefault}'</p>
              </div>
            </div>
          ))}
        </div>
      </div>
    </>
  );
};

export default ThemeClasses;
